export default class Result extends Component{

    render() {
        return (
          <Modal.Dialog show= "true" centered="true" className="special_modal" >
            <Modal.Header closeButton>
              <Modal.Title id="contained-modal-title">Result</Modal.Title>
            </Modal.Header>
            <Modal.Body>
            </Modal.Body>
            <Modal.Footer>
              
            </Modal.Footer>
          </Modal.Dialog>
      
        );
      }
}
